import React from "react";
import "../styles/MobileReviews.css";

/**
 * MobileReviews - mobile-friendly reviews list
 *
 * Usage:
 *   <MobileReviews />
 *
 * It uses a test dataset (you can replace with real props/fetch).
 * The header image used for visual preview (optional) is:
 *   /mnt/data/53765d76-351d-4b4e-979c-b603d564dfed.png
 */
export default function MobileReviews() {
  const overall = {
    score: 4.9,
    count: 1245,
  };

  const reviews = [
    {
      id: 1,
      name: "Aftab Alam",
      time: "4 days ago",
      city: "Kolkata",
      rating: 5,
      text: "Today I sell my car in CarsDedo CC2 hub. I am very satisfied. Here all employees are very good.",
    },
    {
      id: 2,
      name: "Pradeep Sahoo",
      time: "4 days ago",
      city: "Hyderabad",
      rating: 5,
      text:
        "I recently sold my old car through CarsDedo. Obviously it was a nice experience in dealing with CarsDedo. The entire process was smooth, hassle-free, tran...",
    },
    {
      id: 3,
      name: "Sunny Agarwal",
      time: "4 days ago",
      city: "Gurgaon",
      rating: 5,
      text: "Kumar Raj was very helpful and completed the handover formalities smoothly.",
    },
    {
      id: 4,
      name: "Chaitali Bhise",
      time: "4 days ago",
      city: "Faridabad",
      rating: 5,
      text: "Its good experience not hustle & at good price great service",
    },
  ];

  return (
    <section className="ur-root" aria-label="User reviews and ratings">
      {/* Optional header image for visual match (replace or remove if not needed) */}
      <div className="ur-header">
        <img
          src={"/mnt/data/53765d76-351d-4b4e-979c-b603d564dfed.png"}
          alt="User reviews header"
          className="ur-header-img"
        />
      </div>

      <div className="ur-inner">
        <h2 className="ur-title">User Reviews & Ratings</h2>

        <div className="ur-overall">
          <div className="ur-score">{overall.score.toFixed(1)}</div>

          <div className="ur-stars" aria-hidden>
            {Array.from({ length: 5 }).map((_, i) => (
              <span key={i} className={`ur-star ${i < Math.round(overall.score) ? "on" : ""}`}>
                ★
              </span>
            ))}
          </div>
        </div>

        <ul className="ur-list" role="list">
          {reviews.map((r) => (
            <li key={r.id} className="ur-item" role="listitem" aria-label={`${r.name} review`}>
              <div className="ur-item-left">
                {/* small avatar/placeholder — optional: replace src with avatar */}
                <div className="ur-avatar" aria-hidden>
                  {r.name.split(" ").map((n) => n[0]).slice(0, 2).join("")}
                </div>
              </div>

              <div className="ur-item-center">
                <div className="ur-row">
                  <div className="ur-name">{r.name}</div>
                  <div className="ur-meta">
                    <span className="ur-time">{r.time}</span> <span className="ur-sep">|</span>{" "}
                    <span className="ur-city">{r.city}</span>
                  </div>
                </div>

                <p className="ur-text">{r.text}</p>

                {r.text.length > 120 ? (
                  <button
                    className="ur-readmore"
                    onClick={() => {
                      /* wire to expand or navigate */
                      alert("Open full review — implement navigation or expand behaviour.");
                    }}
                  >
                    Read more
                  </button>
                ) : null}
              </div>

              <div className="ur-item-right" aria-hidden>
                <div className="ur-stars-small">
                  {Array.from({ length: 5 }).map((_, i) => (
                    <span key={i} className={`ur-star-small ${i < r.rating ? "on" : ""}`}>
                      ★
                    </span>
                  ))}
                </div>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </section>
  );
}
